	@Test
	void pop_seg() {
		{ /* if (dst.getRegister() == Register.FS) */
			{ /* if (getBitness() == 64) */
				testAssembler(c -> c.pop(fs), Instruction.create(Code.POPQ_FS, ICRegisters.fs));
			} /* else skip !(getBitness() == 64) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.GS) */
			{ /* if (getBitness() == 64) */
				testAssembler(c -> c.pop(gs), Instruction.create(Code.POPQ_GS, ICRegisters.gs));
			} /* else skip !(getBitness() == 64) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.ES) */
			{ /* if (getBitness() >= 32) */
				// Skipping POPD_ES - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.SS) */
			{ /* if (getBitness() >= 32) */
				// Skipping POPD_SS - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.DS) */
			{ /* if (getBitness() >= 32) */
				// Skipping POPD_DS - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		}
	}

	@Test
	void pop_m() {
		{ /* if (dst.size == MemoryOperandSize.QWORD) */
			testAssembler(c -> c.pop(qword_ptr(0x0L).base(rdx)), Instruction.create(Code.POP_RM64, new MemoryOperand(ICRegisters.rdx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE)));
		} /* else */ { /* if (dst.size == MemoryOperandSize.DWORD) */
			// Skipping POP_RM32 - Not supported by current bitness
		} /* else */ { /* if (dst.size == MemoryOperandSize.WORD) */
			testAssembler(c -> c.pop(word_ptr(0x0L).base(rdx)), Instruction.create(Code.POP_RM16, new MemoryOperand(ICRegisters.rdx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE)));
		}
		{
			assertInvalid(() -> {
				testAssembler(c -> c.pop(zmmword_ptr(0x0L).base(rdx)), Instruction.create(Code.POP_RM16, new MemoryOperand(ICRegisters.rdx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE)));
			});
		}
	}

