	@Test
	void push_seg() {
		{ /* if (dst.getRegister() == Register.FS) */
			{ /* if (getBitness() == 64) */
				testAssembler(c -> c.push(fs), Instruction.create(Code.PUSHQ_FS, ICRegisters.fs));
			} /* else skip !(getBitness() == 64) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.GS) */
			{ /* if (getBitness() == 64) */
				testAssembler(c -> c.push(gs), Instruction.create(Code.PUSHQ_GS, ICRegisters.gs));
			} /* else skip !(getBitness() == 64) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.ES) */
			{ /* if (getBitness() >= 32) */
				// Skipping PUSHD_ES - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.CS) */
			{ /* if (getBitness() >= 32) */
				// Skipping PUSHD_CS - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.SS) */
			{ /* if (getBitness() >= 32) */
				// Skipping PUSHD_SS - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		} /* else */ { /* if (dst.getRegister() == Register.DS) */
			{ /* if (getBitness() >= 32) */
				// Skipping PUSHD_DS - Not supported by current bitness
			} /* else skip !(getBitness() >= 32) not supported by this CodeAssembler bitness */
		}
	}

	@Test
	void push_m() {
		{ /* if (dst.size == MemoryOperandSize.QWORD) */
			testAssembler(c -> c.push(qword_ptr(0x0L).base(rdx)), Instruction.create(Code.PUSH_RM64, new MemoryOperand(ICRegisters.rdx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE)));
		} /* else */ { /* if (dst.size == MemoryOperandSize.DWORD) */
			// Skipping PUSH_RM32 - Not supported by current bitness
		} /* else */ { /* if (dst.size == MemoryOperandSize.WORD) */
			testAssembler(c -> c.push(word_ptr(0x0L).base(rdx)), Instruction.create(Code.PUSH_RM16, new MemoryOperand(ICRegisters.rdx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE)));
		}
		{
			assertInvalid(() -> {
				testAssembler(c -> c.push(zmmword_ptr(0x0L).base(rdx)), Instruction.create(Code.PUSH_RM16, new MemoryOperand(ICRegisters.rdx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE)));
			});
		}
	}

	@Test
	void push_i() {
		{ /* if (getBitness() == 64) */
			{ /* if (imm >= -0x80 && imm <= 0x7F) */
				testAssembler(c -> c.push(-0x80), Instruction.create(Code.PUSHQ_IMM8, -0x80));
				testAssembler(c -> c.push(0x7F), Instruction.create(Code.PUSHQ_IMM8, 0x7F));
			} /* else */ testAssembler(c -> c.push(-0x80000000), Instruction.create(Code.PUSHQ_IMM32, -0x80000000));
		} /* else skip !(getBitness() == 64) not supported by this CodeAssembler bitness */
	}

